const Header = () => {
  return (
    <div className="text-center mt-4 mb-2">
      <header>
        <h1 className="text-stroke text-4xl font-bold mb-2">Social Network</h1>
        <hr className="border-t-2 border-gray-700 mx-auto mt-2 mb-4 w-full max-w-2xl" />
      </header>
    </div>
  );
};

export default Header;
